import React from 'react';

function main () {
    return (
      <div className="Menu">
        <header className="Nav_bar">
          <p>Main</p>
          <p>Sign-In</p>
          <p>About</p>
          <p>Contact</p>
        </header>
      </div>
    )
  };
  export default main;
